import React from "react";
import {useState, useEffect} from "react";

function Todo(){

    const [data, setData]= useState([])
    const apiGet = ()=>{
        fetch('http://localhost:1337/api/notice')
        .then((response)=>response.json())
        .then((json)=>{
            console.log(json);
            setData(json);
        })
    }

    useEffect(()=>{
        apiGet();
    },[])

    return (
        <center><div>
            <h2>NOTICE</h2>
            <p>{JSON.stringify(data.user[1].notice,null,2)}</p>
            <p>Undersigned: {JSON.stringify(data.user[1].name,null,2)}</p>
        </div></center>
    )
}

export default Todo

